import '../styles/Navbar.css';
import squealerLogo from '../img/squealerLogo.svg'

function Navbar() {
    return (
        <div className='container-fluid'>
            <div className='row'>
                <div className='col-1'>
                    <img src={squealerLogo} id='navbar-logo'></img>
                    <ul id='navbar-menu-container'>
                        <li><a href=''>Home</a></li>
                    </ul>
                </div>
                <div className='col-5'>

                </div>
                <div className='col-3'></div>
            </div>
        </div>
    );
}

export default Navbar;
